        private static OblivionMod Create_XML_Internal(
            XElement root,
            Func<OblivionMod_ErrorMask> errorMask)
        {
            var ret = new OblivionMod();
            try
            {
                foreach (var elem in root.Elements())
                {
                    Fill_XML_Internal(
                        item: ret,
                        root: elem,
                        name: elem.Name.LocalName,
                        errorMask: errorMask);
                }
            }
            catch (Exception ex)
            when (errorMask != null)
            {
                errorMask().Overall = ex;
            }
            return ret;
        }

